CREATE TABLE `prop` (
  `prop_id` int(11) NOT NULL AUTO_INCREMENT,
  `env_id` int(11) NOT NULL COMMENT '环境ID',
  `prop_name` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '道具名称 ',
  `category_id` int(6) DEFAULT NULL COMMENT '道具类型/同类型为一组id\n',
  `isvalid` tinyint(2) DEFAULT NULL,
  `is_cover` smallint(6) DEFAULT '0' COMMENT '是否允许覆盖0：不允许\n1：允许',
  `passable` tinyint(1) DEFAULT NULL COMMENT '是否 允许 通过',
  `is_damage` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '是否可以破坏\n//可通过道具 类型确定 2个方案选择一个\n实施时对比方案优缺点\n',
  `row` bigint(20) DEFAULT NULL COMMENT '行',
  `column` bigint(20) DEFAULT NULL COMMENT '列',
  `height` bigint(20) DEFAULT NULL COMMENT '高',
  `assets` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '资源路径',
  `resource` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '资源名',
  `icon` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '小图标地址',
  `hp` int(11) DEFAULT NULL,
  `effect_id` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '响应时间绑定id',
  `offset_x` int(10) DEFAULT NULL,
  `offset_y` int(10) DEFAULT NULL,
  `classname` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `mtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `ctime` datetime NOT NULL COMMENT '创建时间',
  `position` varchar(45) COLLATE utf8_unicode_ci NOT NULL COMMENT '道具组位置',
  PRIMARY KEY (`prop_id`),
  KEY `fk_prop_theme` (`env_id`)
) ENGINE=MyISAM AUTO_INCREMENT=84 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='道具基本表';
