  `offset_x` int(10) DEFAULT NULL,
  `offset_y` int(10) DEFAULT NULL,
  `mtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `ctime` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`prop_id`),
  KEY `fk_prop_theme` (`env_id`)
) ENGINE=MyISAM AUTO_INCREMENT=83 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='道具基本表';
